
export enum SoundEffect {
    timerBeep = "timer-beep",
    finalBeep = "final-beep",
    pauseBeep = "pause-beep"
}
/**
 * Play sound effect
 * @param {SoundEffect} effectName - name of sound effect
 */
export function playSoundEffect(effectName: SoundEffect) {
    switch (effectName) {
        case SoundEffect.timerBeep:
            return new Audio(audioBeepPlay).play();
        case SoundEffect.finalBeep:
            return new Audio(audioBeepFinal).play();
        case SoundEffect.pauseBeep:
            return new Audio(audioBeepPause).play();
        default:
            break;
    }
}

/**
 * Enum for sound effects
 */
export enum SoundEffect {
    timerBeep = "timer-beep",
    finalBeep = "final-beep",
    pauseBeep = "pause-beep"
}


// beep sound like real timer
export const audioBeepPlay = 'data:audio/mp3;base64,'

// pause sound - blip
export const audioBeepPause = 'data:audio/mp3;base64,'


//final beep sound is bwong    
export const audioBeepFinal = 'data:audio/mp3;base64,'